// SPDX-License-Identifier: MIT

// Solidity version 
// >=, >, <=, < : solidity   
// ^version :  
pragma solidity >=0.7.0 <0.9.0;

// contract 
contract Mileage {

    //    (       )
    //    
    // internal :    
    address internal owner;

    //   :   (deploy)       
    constructor(){
        //    owner 
        owner = msg.sender;
    }

    //    mapping data 
    // mapping : json    key : value  
    // solidity mapping  key   value    
    mapping(string => uint) internal mileage;
    //    mapping  
    // mapping bool     false 
    mapping(string => bool) internal exists;

    //  (modifier ) :    ->     
    //        
    modifier onlyOwner(){
        // require(, ) :     , 
        //       .
        require(msg.sender == owner, "Only the owner can execute the function");
        // _ :     
        _;
    }

    //          
    modifier checkUser(
        string memory _user
    ){
        // exists mapping    
        // exists _user    true
        require(exists[_user], "You are an unregistered user");
        _;
    }

    //   (   )
    function add_user(
        string memory _user
    ) public onlyOwner{
        //     -> mapping value true 
        if(!exists[_user]){
            exists[_user] = true;
        }
    }

    //   ( 1 :   ?  , 2 :   ? )
    // 1 onlyOwner  2 checkUser 
    function add_mileage(
        string memory _user, 
        uint _amount
    ) public onlyOwner checkUser(_user){
        //   -> mileage mapping data value . 
        // a += 10 -> a = a + 10
        mileage[_user] += _amount;       // mileage[_user] = mileage[_user] + _amount ;
    }

    //     ( 1 :    ?, 2 :     ?  3 :    ? )
    function trans_mileage(
        string memory _sender, 
        string memory _receiver, 
        uint _amount
    )public onlyOwner checkUser(_sender) checkUser(_receiver){
        // 4 :     _amount   .
        require(mileage[_sender] >= _amount, "Not enough mileage");
        //    _amount  
        mileage[_sender] -= _amount;
        //    _amount  
        mileage[_receiver] += _amount;
    }

    //      (1 :     )
    function view_mileage(
        string memory _user
    )public checkUser(
        _user
    ) view returns(
        uint
    ){
        return mileage[_user];
    }

}
